-- Objede character / accessory var m?
local function isInAnyCharacter(obj)
    local parent = obj.Parent
    while parent do
        if parent:IsA("Model") and parent:FindFirstChild("Humanoid") then
            return true
        end
        if parent:IsA("Accessory") or parent:IsA("Tool") then
            return true
        end
        parent = parent.Parent
    end
    return false
end

-- Geerli targetlar bul
local function getTargetParts()
    local parts = {}

    for _, obj in ipairs(workspace:GetDescendants()) do
        if obj:IsA("MeshPart") and obj.MeshId == TARGET_MESH_ID then
            if not isInAnyCharacter(obj) then
                table.insert(parts, obj)
            end

        elseif obj:IsA("SpecialMesh") and obj.MeshId == TARGET_MESH_ID then
            local parentPart = obj.Parent
            if parentPart and parentPart:IsA("BasePart") and not isInAnyCharacter(parentPart) then
                table.insert(parts, parentPart)
            end
        end
    end

    return parts
end

-- Alt platform olutur
local function createPlatformBelow(character)
    local hrp = character:FindFirstChild("HumanoidRootPart")
    if hrp then
        if hrp:FindFirstChild("TempPlatform") then
            hrp.TempPlatform:Destroy()
        end

        local platform = Instance.new("Part")
        platform.Name = "TempPlatform"
        platform.Size = Vector3.new(6, 1, 6)
        platform.Anchored = true
        platform.CanCollide = true
        platform.Material = Enum.Material.SmoothPlastic
        platform.Color = Color3.fromRGB(0, 0, 0)
        platform.CFrame = hrp.CFrame - Vector3.new(0, hrp.Size.Y/2 + platform.Size.Y/2, 0)
        platform.Parent = hrp
    end
end

-- Random teleport loop
local function startTeleport()
    if teleportThread then
        task.cancel(teleportThread)
        teleportThread = nil
    end
    
    teleportThread = task.spawn(function()
        while teleporting do
            local character = player.Character
            local hrp = character and character:FindFirstChild("HumanoidRootPart")
            if not hrp then
                task.wait(0.1)
                continue
            end

            local targets = getTargetParts()
            if #targets > 0 then
                local randomIndex = math.random(1, #targets)
                local randomPart = targets[randomIndex]

                if randomPart and randomPart:IsDescendantOf(workspace) then
                    hrp.CFrame = randomPart.CFrame + Vector3.new(0, 3, 0)
                    createPlatformBelow(character)
                end
            end

            task.wait(collectSpeed)
        end
    end)
end

-- Auto Trade fonksiyonu
local function startAutoTrade()
    if tradeThread then
        task.cancel(tradeThread)
        tradeThread = nil
    end
    
    tradeThread = task.spawn(function()
        while autoTrading do
            local success, errorMessage = pcall(function()
                local args = {
                    [1] = tradePosition
                }
                
                -- ReplicatedStorage'dan servisi bul
                local replicatedStorage = game:GetService("ReplicatedStorage")
                local packages = replicatedStorage:FindFirstChild("Packages")
                
                if packages then
                    local knitPackage = packages._Index:FindFirstChild("sleitnick_knit@1.7.0")
                    if knitPackage then
                        local knit = knitPackage:FindFirstChild("knit")
                        if knit then
                            local services = knit:FindFirstChild("Services")
                            if services then
                                local featherService = services:FindFirstChild("FeatherService")
                                if featherService then
                                    local remoteFunction = featherService:FindFirstChild("RF")
                                    if remoteFunction then
                                        local submitFunction = remoteFunction:FindFirstChild("SubmitFeathersForPeacock")
                                        if submitFunction then
                                            submitFunction:InvokeServer(unpack(args))
                                        end
                                    end
                                end
                            end
                        end
                    end
                end
            end)
            
            if not success then
                warn("Auto Trade Hatas:", errorMessage)
            end
            
            task.wait(0.1) -- Her 0.1 saniyede bir ticaret yap
        end
    end)
end

